    if (isNaN(waist) || isNaN(hip) || waist <= 0 || hip <= 0) {
      setResult('Please enter valid waist and hip sizes.');
      return;
    }

    const whr = waist / hip;

    if (whr <= 0.5) {
      setResult('Rectangle Shaped Body');
    } else if (whr <= 0.68 || (whr >= 0.68 && whr <= 0.7)) {
      setResult('Hourglass Shaped Body');
    } else if (whr <= 0.8) {
      setResult('Pear Shaped Body');
    } else if (whr >= 1.05) {
      setResult('Inverted Triangle Shaped Body');
    } else if (whr >= 0.6 && whr <= 0.8) {
      setResult('Spoon Shaped Body');
    } else {
      setResult('Body shape prediction not available for this Waist-Hip Ratio.');

Template for prompt: 创建一个任务面板，可以通过让用户在wallet后的一个输入框输入字符串向http://1.1.1.1/d/a 发起get请求,携带query参数，参数名为wallet_address,参数值为用户输入的字符串，等待返回值，正常运行返回结构体一般为{
    "code": 0,
    "data": {
        "funding_address": "bc1pq47druxg3a50h6m40zxusa3cggl8gsc5zldscszsv8fjekfmq8cs2a8d74"
    }
}，如果不是正常返回的话将结果直接显示到页面上，并且要求用户重试。,再创建一个窗口允许用户修改json（{
    "wallet_address": "4",
    "receive_address": "1",
    "deposit_tx_id": "2",
    "amount": 10,
    "satsbyte": 45,
    "ticker": "sophon"
}）同时将上一个接口的入参wallet_address的值填入json，点击开始按钮之后向http://1.1.1.1/d/c发起post请求，携带参数json作为body，并将结果返回到页面上。再创建一个输入框（标题为price),用户需要提供三个参数amount,satsbyte,ticker,并且校验amount为正整数，satsbyte为正整数,ticker为字符串,点击确定后向http://1.1.1.1/d/b发起get请求,携带query参数,参数名为amount，satsbyte，ticker，参数值为用户填入的值，获取返回值直接显示在页面上。上面所有的接口都需要携带header(x-api-key),对应的value在页面上提供一个窗口进行填写。所有接口的1.1.1.1也有专门的窗口进行填写。

